import React, { useEffect, useState }  from 'react'

import { BrowserRouter,Routes, Route, Outlet, Navigate } from 'react-router-dom'

import {Header,Footer} from '../../containers/index';

import { Home, Topics, Topic,Posts, Post, Popular, Bookmarks, Courses, Course, Createpost, Profile, Registration, Search_results, Login } from '../../pages/index';

import './router.css'

import axios from 'axios'


const Router = () => {
    const [user, setUser] = useState(null);

    useEffect(() => {
        axios.get('http://localhost:4000/api/current_user')
          .then(response => {
            const { username, _id } = response.data;
            setUser({ username, _id }); 
          })
          .catch(error => {
            console.error('Error fetching user:', error);
          });
    }, []);


    const Layout = () => {
        return (
            <div className="layout__container">
                <Header/>
                <Outlet/>
                <Footer/>
            </div>
        )
    }
    
    const BrowserRoutes = () => {
        return (
            <BrowserRouter>
                <Routes>
                    <Route path='/' element={<Layout/>}>
                        <Route index element={<Home/>} />
                        <Route path='/home' element={<Home/>} />
                        <Route path='/topics' element={<Topics/>}/>
                        <Route path='/topics/:id' element={<Topic/>}/>
                        <Route path='/posts' element={<Posts/>}/>
                        <Route path='/posts/:id' element={<Post/>}/>
                        <Route path='/popular' element={<Popular/>}/>
                        <Route path='/bookmarks' element={<Bookmarks/>}/>
                        <Route path='/courses' element={<Courses/>}/>
                        <Route path='/courses/:id' element={<Course/>}/>
                        <Route
                            path='/createpost'
                            element={user ? <Createpost /> : <Navigate to='/home' replace />}
                        />
                        <Route path='*' element={<Home/>} />
                        <Route path='/profile/:id' element={<Profile/>}/>
                        <Route path='/register' element={<Registration/>}/>
                        <Route path='/search-results' element={<Search_results/>}/>
                        <Route path='/login' element={<Login/>}/>
                    </Route>
                </Routes>
            </BrowserRouter>
        )
    }

    return (
        <>
        <BrowserRoutes/>
        </>
    )
}

export default Router
